			//var offsetPixels = 0.15

			// This is the second line
			var x1p = x1 + offsetPixels * (y2-y1) / r
			var x2p = x2 + offsetPixels * (y2-y1) / r
			var y1p = y1 + offsetPixels * (x1-x2) / r
			var y2p = y2 + offsetPixels * (x1-x2) / r

			
			
			result.push([x1p, y1p]);
